import React from 'react';
import SignUp from './SignUp';
import SignIn from './SignIn';
import {
    Switch,
    Route
} from 'react-router-dom';
import Sidebar from '../sharecomponents/sidebar/Sidebar';

const routes = [
    {
        path: '/auth/signin',
        component: SignIn,
    },
    {
        path: '/auth/signUp',
        component: SignUp,
    },
]

function Auth() {
    return (
        routes.map((route, index) => {
            return (<>
                <Sidebar />
                <Route key={index} path={`${route.path}`}>
                    <route.component />
                </Route>
            </>
            )
        })
    )
}

export default Auth;
